/** @format */
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import TextField from "@mui/material/TextField";
import Stack from "@mui/material/Stack";
import { DesktopDatePicker } from "@mui/x-date-pickers/DesktopDatePicker";
import { LocalizationProvider } from "@mui/x-date-pickers/LocalizationProvider";
import { AdapterDateFns } from "@mui/x-date-pickers/AdapterDateFns";
import Button from "@mui/material/Button";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Modal from "@mui/material/Modal";

import "./App.css";

const style = {
	position: "absolute",
	top: "40%",
	left: "50%",
	transform: "translate(-50%, -50%)",
	width: 400,
	bgcolor: "background.paper",
	boxShadow: 24,
	p: 4,
	textAlign: "center",
};

const AppModal = ({ open, handleClose, title, description, children }) => {
	return (
		<Modal
			open={open}
			handleClose={handleClose}
			aria-labelledby="modal-modal-title"
			aria-describedby="modal-modal-description"
		>
			<Box sx={style}>
				<Typography id="modal-modal-title" variant="h6" component="h2">
					{title}
				</Typography>
				<Typography id="modal-modal-description" sx={{ mt: 2 }}>
					{description}
				</Typography>
				<div>{children}</div>
			</Box>
		</Modal>
	);
};

const Date = () => {
	const [value, setValue] = React.useState("");

	const handleChange = (newValue) => {
		setValue(newValue);
	};
	return (
		<div>
			<LocalizationProvider dateAdapter={AdapterDateFns}>
				<Stack spacing={3}>
					<DesktopDatePicker
						label="Year of Birth"
						inputFormat="yyyy"
						value={value}
						onChange={handleChange}
						renderInput={(params) => <TextField {...params} />}
					/>
				</Stack>
			</LocalizationProvider>
		</div>
	);
};

const Content = () => {
	const [open, setOpen] = useState(false);
	const handleOpen = () => setOpen(true);
	const handleClose = () => setOpen(false);
	const navigate = useNavigate();
	const handleSubmit = (e) => {
		e.preventDefault()
	}

	return (

		<div className="form">
			<form>
				<div className="input_field">
					<div className="input__field__value">
						<TextField
							id="outlined-basic"
							label="Symptom"
							variant="outlined"
							style={{ width: "40rem" }}
						/>
					</div>
					<div className="input__field__value">
						<TextField
							id="outlined-basic"
							label="Gender"
							variant="outlined"
							text-field
							style={{ width: "40rem" }}
						/>
					</div>
					<div className="input__field__value">
						<div>
							<Date />
						</div>
					</div>
				</div>
				<div className="btn">
					<Button onClick={handleOpen} variant="contained" size="large">
						diagnose
					</Button>
				</div>
			</form>

			<div>
				<AppModal
					title="Your result is ready!"
					description="Please proceed to next steps to view details"
					open={open}
				>
					<div className="modal__close">
						<button className="modal__btn-close" onClick={handleClose}>
							close
						</button>
					</div>
					<div>
						<Button onClick={() => navigate("/result")} variant="contained">
							proceed
						</Button>
					</div>
				</AppModal>
			</div>
		</div>
	);
};

function App() {
	return (
		<div className="App">
			<div className="header">
				<h1>The best place to diagnose your health</h1>
			</div>

			<Content />
		</div>
	);
}

export default App;
